import React, { useState } from "react";
import "./LoginPage.css";
// import { FaBars, FaTwitter } from "react-icons/fa";
export default function LoginPage() {
  return (
    <div>
      <Navbar />
      <Login />
    </div>
  );
}
const Navbar = () => {
  return (
    <nav>
      <div className="nav-center">
        <div className="nav-header">
          <h2>LMS</h2>
        </div>
      </div>
    </nav>
  );
};

const Login = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const handleSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <main className="bgc">
      <div className="holder">
        <div className="title">
          <h2 style={{ color: "white" }}>Join now</h2>
          <h3 style={{ color: "white" }}>
            Learning Management System where Learning meets the skies and every
            one not only understand but also feels
          </h3>
        </div>
        <article className="form-container">
            <div className="form-box">
          <div className="header-form">
            <h4 className="text-primary text-center"><i className="fa fa-user-circle" style={{fontSize:"110px"}}></i></h4>
            <div className="image">
            </div>
          </div>
          <div className="body-form">
           <form>
              <div className="input-group mb-3">
   <div className="input-group-prepend">
    <span className="input-group-text"><i class="fa fa-user"></i></span>
  </div>
  <input type="text" className="form-control" placeholder="Username" />
</div>
 <div className="input-group mb-3">
   <div className="input-group-prepend">
    <span className="input-group-text"><i class="fa fa-lock"></i></span>
  </div>
  <input type="text" className="form-control" placeholder="Password" />
</div>
 <button type="button" className="btn btn-secondary btn-block">LOGIN</button>
 <div className="message">
<div><input type="checkbox" /> Remember ME</div>
 <div><a href="#">Forgot your password</a></div>
 </div>
   </form>
            <div className="social">
              <a href="#"><i className="fab fa-facebook"></i></a>
              <a href="#"><i className="fab fa-twitter-square"></i></a>
              <a href="#"><i className="fab fa-google"></i></a>
            </div>
          </div>
        </div>
          {/* <form className="form" onSubmit={handleSubmit}>
            <div className="input-container">
              <input type="text" placeholder="Username" />
              <i class="zmdi zmdi-account zmdi-hc-lg"></i>
            </div>

            <div className="input-container">
              <input className={{ color: `lighten(#27282d, 65%)`, borderBottom: `1px solid lighten(#999ca8, 25%) `}} type="password" placeholder="Password" />
              <i class="zmdi zmdi-lock zmdi-hc-lg"></i>
            </div>

            <button type="submit">Log In</button> */}
            {/* <div className="form-control">
              <label htmlFor="email">Email : </label>
              <input
                type="email"
                id="email"
                name="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
            <div className="form-control">
              <label htmlFor="password">Password : </label>
              <input
                type="password"
                id="password"
                name="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>
            <button type="submit">Login</button> */}
          {/* </form> */}
        </article>
      </div>
    </main>
  );
};
